import "./App.css";
import { Route, Switch } from "react-router-dom";

import AllWinesPage from "./Pages/AllWines";
import ProfilePage from "./Pages/Profile";
import QuizPage from "./Pages/Quiz";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <AllWinesPage />
        </Route>
        <Route path="/profile">
          <ProfilePage />
        </Route>
        <Route path="/quiz">
          <QuizPage />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
